import React from "react";
import { Form, Input, Button } from "antd";
import axios from "axios";

const FormItem = Form.Item;

class PostShopData extends React.Component {
  state = {
    dataS: [],
  };

  componentDidMount() {
    axios.get("http://127.0.0.1:8000/shops/api_data/").then((res) => {
      this.setState({
        dataS: res.data,
      });
      console.log(res.data);
    });
  }

  render() {
    return (
      <div>
        <Form>
          <FormItem label="name">
            <Input placeholder="Shop Name" />
          </FormItem>
          <FormItem label="location">
            <Input placeholder="Shop Location" />
          </FormItem>
          <FormItem label="contact">
            <Input placeholder="Shop Contact" />
          </FormItem>
          <FormItem>
            <button type="primary" htmlType="submit">
              Submit
            </button>
          </FormItem>
        </Form>
      </div>
    );
  }
}

export default PostShopData;
